import React from 'react'
import ItemPicture from './imgs/gift_store/starbucks_logo.png'

const GiftShopItem = () => {
  return (
    <div className="giftshop_item">
      <img className="item_picture" src={ItemPicture} alt="" />
    </div>
  )
}

export default GiftShopItem
